import React from 'react';
import styled from 'styled-components';
import { useAuth } from '../../contexts/AuthContext';

const DashboardContainer = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 2rem;
`;

const WelcomeCard = styled.div`
  background: white;
  border-radius: 15px;
  padding: 2rem;
  margin-bottom: 2rem;
  box-shadow: 0 6px 20px rgba(0, 0, 0, 0.1);
`;

const Dashboard = () => {
  const { user } = useAuth();

  return (
    <DashboardContainer>
      <WelcomeCard>
        <h1>Welcome, {user?.name}!</h1>
        <p>Your wedding planning dashboard is ready.</p>
      </WelcomeCard>

      <div>
        <h2>Dashboard Features</h2>
        <ul>
          <li>Your Bookings</li>
          <li>Wishlist</li>
          <li>Wedding Timeline</li>
          <li>Budget Tracker</li>
          <li>Vendor Communications</li>
        </ul>
      </div>
    </DashboardContainer>
  );
};

export default Dashboard;
